import logo from './logo.svg';
import './App.css';
import './Logo.css';

function App() {
  return (
    <div className="App">


    <button class="button" data-text="Awesome">
    <span class="actual-text">&nbsp;Canil&nbsp;Eduardo</span>
    <span aria-hidden="true" class="hover-text">&nbsp;Canil&nbsp;Eduardo</span>
    </button>

    <div>
      <input type='date'></input>
      <input placeholder='Digite a quantidade de cães pequenos'></input>
      <input placeholder='DIgite a quantidade de cães grandes'></input>
      </div>
      <div className='result'>
        <span> Bloco resultado</span>
      </div>

    </div>


  );
}

export default App;
